It looks like it's back to spacing, I didn't get to see. I agree, less is more with design typically. Sometimes it makes sense to put items in cards, but you typically have a darker background when you do this. And not everything should go in a card or you end up with everything looking the same. ProductHunt does a good job of following these principles. 

@nonfungiblemoyo if your looking for a task you could try using Product Hunt's style to do a riff of the project detail page. I'm not sure if we will use it, but it could be a good design exercise for you to sharpen your skill set. 

I encourage you to do almost an exact copy of Product Hunt's stlye (basically copying it/tracing it) and then do a second riff that brings in our style.

@kevalin, 

@Satoshiba and I have been exploring a stronger visual style/brand now that we have a little breathing room. 

Can you create a new figma file called "Visual Design & Brand" and invite @Satoshiba, @adelidusiam, myself, and another designer named Corey. I'll DM you his email.

Corey is the best visual/brand designer I know and he said he would be willing to jam with us a little this week.

Here is the inspiration we have been collecting. Let me know if there is any other sites/brands you would like us to key off of. 

I'm a big fan of Shopify's newest style for their NFT/web3 initiative (the web3 vibes style). However, there are merits to the Modern Tech style as well.
